import React from "react";

export default function Projects() {
  const projects = [
    { name: "Portfolio Website", desc: "A personal portfolio in React" },
    { name: "E-commerce App", desc: "React + Node.js + MongoDB full stack app" },
  ];

  return (
    <section id="projects">
      <h2>Projects</h2>
      {projects.map((p, i) => (
        <div
          key={i}
          style={{
            marginBottom: "15px",
            padding: "10px",
            border: "1px solid gray",
            borderRadius: "10px",
          }}
        >
          <h3>{p.name}</h3>
          <p>{p.desc}</p>
        </div>
      ))}
    </section>
  );
}
